import React, { useState, useEffect } from "react";
import Axios from "axios";
/* import Create from "./test";
 */ const App = () => {
  const [movie, setData] = useState([]);
  const api =
    "https://api.themoviedb.org/3/search/movie?api_key=fac34116c639f3e75cd5205251be421c&query=search";

  useEffect(() => {
    const posts = Axios.get(api).then(json => console.log(json.data.results));
  }, [api]);

  return <li>{posts.data.results}</li>;
};

export default App;
